### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Reinforcement Learning Basics**
   - **Multi-Armed Bandit Problem**: Understanding the $\epsilon$-greedy policy and reward distributions.
   - **Markov Decision Processes (MDPs)**: States, actions, transition probabilities, and rewards.
   - **Value Functions and Policies**: Optimal policies, state value functions ($v_{\pi}(s)$), and action value functions ($q_{\pi}(s, a)$).

2. **Bellman Equations**
   - **Bellman Equation for State Value Function**:
     \[ v_{\pi}(s) = \sum_a \pi(a|s) \sum_{s'} \sum_r p(s', r | s, a) [r + \gamma v_{\pi}(s')] \]
   - **Bellman Equation for Action Value Function**:
     \[ q_{\pi}(s, a) = \sum_{s'} \sum_r p(s', r | s, a) [r + \gamma \sum_{a'} \pi(a'|s') q_{\pi}(s', a')] \]

3. **Value Iteration**
   - **Value Iteration Algorithm**: Iterative method to compute the optimal value function.
   - **Synchronous Updates**: Updating the value function for all states simultaneously.

4. **Grid World Problems**
   - **Deterministic Transitions**: Understanding how actions affect state transitions in a grid world.
   - **Optimal Policies and Value Functions**: Calculating optimal policies and corresponding value functions in a grid world.

5. **Discounted Returns**
   - **Return Calculation**: Sum of discounted rewards.
     \[ G_t = \sum_{k=0}^{\infty} \gamma^k R_{t+k+1} \]
   - **Infinite Series**: Calculating the sum of an infinite series of discounted rewards.

#### Important Equations

1. **$\epsilon$-Greedy Policy**
   - Probability of choosing the best arm: \(1 - \epsilon + \frac{\epsilon}{k}\)
   - Probability of choosing any other arm: \(\frac{\epsilon}{k}\)
   - Where \(k\) is the number of arms.

2. **State Value Function**
   \[ v_{\pi}(s) = \sum_a \pi(a|s) \sum_{s'} \sum_r p(s', r | s, a) [r + \gamma v_{\pi}(s')] \]

3. **Action Value Function**
   \[ q_{\pi}(s, a) = \sum_{s'} \sum_r p(s', r | s, a) [r + \gamma \sum_{a'} \pi(a'|s') q_{\pi}(s', a')] \]

4. **Return Calculation**
   \[ G_t = \sum_{k=0}^{\infty} \gamma^k R_{t+k+1} \]

5. **Value Iteration Update**
   \[ v(s) = \max_a \sum_{s'} p(s'|s, a) [r(s, a, s') + \gamma v(s')] \]

